import styled from "styled-components"
import { IoExitOutline } from 'react-icons/io5'

export default function InitalPage(){
    return(
        <Container>
            <header>
                <h1>Olá, Fulano</h1>
                <IoExitOutline size={24} color={'#ffffff'} />
            </header>
            <Content>
                <h2>Não há registros de entrada ou saída!</h2>
            </Content>
            <Section>
                <button>
                    a
                    Nova entrada
                </button>
                <button>
                    <h2>a</h2>
                    Nova saída
                </button>
            </Section>
        </Container>
    );
}

const Container = styled.div`
    display: flex;
    align-items: center;
    flex-direction: column;
    width: 100%;
    height:915px;
    padding-left: 24px;
    padding-right: 24px;
    padding-top: 24px;
    padding-bottom: 16px;
    background-color: #8C11BE;

    header{
        width: 100%;
        display: flex;
        justify-content: space-between;
        align-items: center;

        h1{
            font-size: 26px;
            color: #FFFFFF;
        }
    }

    form{
        display: flex;
        justify-content: space-around;
        align-items: center;
        flex-direction: column;
        width: 326px;
        height: 200px;

        input{
            width: 100%;
            height: 56px;
            background-color: #FFFFFF;
            border: none;
            border-radius: 6px;
            padding-left: 16px;

            &::placeholder{
                font-size: 20px;
                color: #000000;
            }
        }

        button{
            width: 100%;
            height: 46px;
            font-size: 20px;
            background-color: #A328D6;
            color: #FFFFFF;
            border: none;
            border-radius: 6px;
        }
    }

    h3{
        margin-top: 36px;
        font-size: 16px;
        color: #FFFFFF;
    }
`

const Content = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: row;
    background-color: #ffffff;
    margin-top:22px;
    width: 326px;
    height: 446px;

    h2{
        width: 180px;
        height: 46px;
        font-size: 20px;
        color:#868686;
        text-align: center;
    }
`

const Section = styled.div`
    display: flex;
    justify-content: space-between;
    width: 326px;
    height: 114px;
    margin-top: 14px;

    div{
        display: flex;
        flex-direction: row;
        justify-content: space-between;
        width: 154px;
        background-color: #A328D6;
        border: none;
        border-radius: 6px;
        font-size: 16px;
        color: #FFFFFF;
    }
`
